/* Eigene Plugins */
(function($) {
	/* Placeholder */
	$.fn.placeholder = function() {
		var $this = $(this),
			value = $this.attr('placeholder');
	
		$this.attr('data-placeholder-text', value)
			.attr('placeholder','')
			.addClass('placeholder')
			.val(value);
			
		$this.focus(function() {
			if ($this.val() == $this.attr('data-placeholder-text')) {
				$this.val('');
			}
			$this.addClass('active');
		});
		$this.blur(function() {
			if ($this.val() == '') {
				$this.val($this.attr('data-placeholder-text'));
				$this.removeClass('active');
			}		
		});
	};

	/* Dropdown-Animation - 'elem' as opening layer */
	$.fn.initDropdown = function(elem) {
		var $this = $(this),
			$elem = $this.find(elem),
			height = $elem.css('visibility', 'hidden').show().height();
		$elem.height(0).css('visibility', '');
		$elem.data('height',height);

		$this.addClass('js-dropdown').bind('click', function() {
			if($this.hasClass('open')) {
				$elem.animate({
					height: 0
				},{
					duration: 700,
					complete: function() {
						$this.removeClass('open');
					}
				});
			}
			else {
				$this.addClass('open');
				$elem.animate({
					height: $elem.data('height')
				},{
					duration: 700
				});
			}
		});
	};

	/* Zweispaltige Downloadliste */
	
	$.fn.downloadListCol2 = function() {
		/* Downloadliste - Zeilenanpassung */
	
		var heightsleft = new Array();
		var heightsright = new Array();
		var counter = 0;
		
		/* Vergleich */
		
		$(this).find('> ul:first-child li').each(function(){
			 heightsleft[counter] = $(this).height();
			 counter = counter + 1;
		});
		
		counter = 0;
		
		$(this).find('> ul:first-child + ul li').each(function(){
			 heightsright[counter] = $(this).height();
			 counter = counter + 1;
		});
		
		/* Setzen des zweiten Counters */
		
		var entrysleft = heightsleft.length;
		var entrysright = heightsright.length;
		var entrysresult = entrysleft;
		if(entrysleft > entrysright) {
			$(this).find('> ul:first-child + ul').css('border', 'none');
			entrysresult = entrysright;
		}
		if(entrysleft <= entrysright) {
			$(this).find('> ul:first-child').css('border', 'none');
		}
		var counter2 = entrysresult;
		
		for(var i = 0; i < counter2; i++) {
			var height = heightsleft[i];
			if(height < heightsright[i]) {
				height = heightsright[i];
			}
			$(this).find('> ul:first-child li').eq([i]).css('height', height);
			$(this).find('> ul:first-child + ul li').eq([i]).css('height', height);
		}		
	};
	

	$.fn.appsAndInfos = function(data) {
		var $this = $(this);
		
		$this.html(data);
		
		/* Checkbox - Filtering */
		$('.checkbox', $this).on('click', function() {
			var $checkbox = $(this),
				url = $this.data('url') + '?',
				active = $this.find('.tabs-content .active').attr('class');
				
			$checkbox.toggleClass('active');
			
			//active Tab
			url += 'active=' + active.replace('active', '').replace(' ', '');
			
			//Location based results
			if( $this.data('location') && $this.data('location') != '' ) {
				url += '&location=' + $this.data('location');
			}
			if( $this.data('label') && $this.data('label') != '' ) {
				url += '&label=' + encodeURIComponent( $this.data('label') );
			}
			// Filter Apps or Infos
			if( $this.find('.filter .checkbox.active').length == 1 ) {
				url += '&filter=' + $this.find('.filter .checkbox.active').data('name');
			}
			else if( $this.find('.filter .checkbox.active').length == 0 ) {
				url += '&filter=none';
			}
			
			$this.html('<div class="ajax-loader"></div>');
			$.ajax({
				cache: $('#login .button').hasClass('logged out'),
				url: url,
				dataType: 'html',
				success: function(data) {
					$this.appsAndInfos(data);
				}
			});
		});
		/* Tooltips */
		$('.ico', $this).hoverIntent(function() {
			$(this).find('.tooltip').fadeTo(300,1);	
		},
		function() {
			$(this).find('.tooltip').hide();
		});
		/* Tabs */
		$('.tabs-menu li a', $this).on('click', function(event) {
			event.preventDefault();
			var $tab = $(this),
				$tabmenu = $tab.parents('.apps-infos-tabs');
			$tab.parents('.tabs-menu').find('li.active').removeClass('active');
			$tab.parent().addClass('active');
			$tabmenu.find('.tabs-content ul').removeClass('active');
			if( $tab.parent().hasClass('alphabetical') ){
				$tabmenu.find('.tabs-content ul.alphabetical').addClass('active');
			}
			else if( $tab.parent().hasClass('vendor') ) {
				$tabmenu.find('.tabs-content ul.vendor').addClass('active');
			}
			else if( $tab.parent().hasClass('date') ) {
				$tabmenu.find('.tabs-content ul.date').addClass('active');
			}		
			return false;
		});
		/* Search - Filtering */
		$('.search input', $this).placeholder();
		$('.search input', $this).on('keyup', function(e) {
			e.preventDefault();
			
			var value = $(this).val().toLowerCase();
			$('.tabs-content ul li', $this).show();
			$('.tabs-content ul li span', $this).each(function() {
				if( $(this).text().toLowerCase().indexOf(value) !== 0 ) {
					$(this).closest('li').hide();
				}
			});
			
			return false;
		});

	};
})(jQuery);


